import styled from 'styled-components';

export const VendasDiv = styled.div`
  max-width: 100%;
  height: 100%;
  display: inline-block;
  @media(max-width: 1080px){
    margin: 0 auto;
    max-width: 100%;
    justify-content: center;
  }
`;
